const contactInfo = {
    address: '1300 Center Avenue',
    city: 'Fresno',
    state: 'California',
    country: 'United States',
    phone: '+123-456-7890',
    email: 'info@example.com',
    social: [
      { url: 'https://www.facebook.com/', icon: 'facebook' },
      { url: 'https://twitter.com/login?lang=en', icon: 'twitter' },
      { url: 'https://www.linkedin.com/', icon: 'linkedin' },
      { url: 'https://www.instagram.com/', icon: 'instagram' },
      { url: 'https://accounts.google.com/servicelogin/signinchooser?flowName=GlifWebSignIn&flowEntry=ServiceLogin', icon: 'googleplus' }
    ]
  };

  const usefulLinks = [
    {
      title: 'About Us',
      links: [
        { url: '#', text: 'Home' },
        { url: '#about', text: 'About us' },
        { url: '#service', text: 'Our services' },
        { url: '#', text: 'Terms & condition' },
        { url: '#', text: 'Privacy policy' }
      ]
    },
    {
      title: 'Useful Links',
      links: [
        { url: '#portfolio', text: 'Portfolio' },
        { url: '#team', text: 'Team' },
        { url: 'careers.html', text: 'Career' },
        { url: '#contact', text: 'Contact' },
        { url: '#faq', text: 'FAQ' }
      ]
    }
  ];

  const subscription = {
    text: 'With Our Skills Put Together, You Get An Ensemble Capable Of Doing Anything And Everything Your Brand Needs. Subscribe Here To Get Our Latest Updates.',
    copyright: 'Copyright © 2021 IT Company Website. All Rights Reserved.'
  };
